llm_prompt_template:
My primary goal is to execute lots of small, high-frequency trades with a higher risk tolerance.

The current trading cycle is 30 minutes.

You are an expert financial analyst. Analyze the following information for {symbol}:

Current Price: ${current_price}

Recent Price History & Technical Indicators (last few days/weeks, simplified):
{history_str}

Recent News Headlines (from real-time Alpaca WebSocket, most relevant to this cycle):
{news_str}

Past Trading Performance/Reflections (my AI's previous actions/outcomes for this asset):
{past_trades_summary}

---
You have access to the following technical indicators: SMA_20, RSI, MACD, Bollinger Bands, OBV, ATR, and others. Use them in your analysis and explain how they influence your recommendation. If news headlines are present, consider their immediate impact for this cycle.

Based on this data, provide your response in the following strict JSON format (do not include any explanation, ```json, or text outside the JSON):
{
  "sentiment": <integer from -100 to 100>,
  "action": "BUY" | "SELL" | "HOLD",
  "reasoning": <string>,
  "risks": <string>
}
